INSERT INTO `files` VALUES (_binary 'AúA\Ïÿ\îX\ô\í_\èŠ\Å','py',_binary 'from flask import Flask,redirect,url_for,render_template,request,flash,abort,session\r\nfrom flask_session import Session\r\nfrom key import secret_key,salt1,salt2\r\nfrom stoken import token\r\nfrom cmail import sendmail\r\nfrom itsdangerous import URLSafeTimedSerializer\r\nimport mysql.connector\r\napp=Flask(__name__)\r\napp.secret_key=secret_key\r\napp.config[\'SESSION_TYPE\']=\'filesystem\'\r\nSession(app)\r\nmydb=mysql.connector.connect(host=\'localhost\',user=\'root\',password=\'admin\',db=\'prm\')\r\n@app.route(\'/\')\r\ndef index():\r\n    return render_template(\'title.html\')\r\n@app.route(\'/login\',methods=[\'GET\',\'POST\'])\r\ndef login():\r\n    if session.get(\'user\'):\r\n        return redirect(url_for(\'home\'))\r\n    if request.method==\'POST\':\r\n        username=request.form[\'username\']\r\n        password=request.form[\'password\']\r\n        cursor=mydb.cursor(buffered=True)\r\n        cursor.execute(\'select count(*) from users where username=%s\',[username])\r\n        count=cursor.fetchone()[0]\r\n        if count==1:\r\n            cursor.execute(\'select count(*) from users where username=%s and password=%s\',[username,password])\r\n            p_count=cursor.fetchone()[0]\r\n            if p_count==1:\r\n                session[\'user\']=username\r\n                cursor.execute(\'select email_status from users where username=%s\',[username])\r\n                status=cursor.fetchone()[0]\r\n                cursor.close()\r\n                if status!=\'confirmed\':\r\n                    return redirect(url_for(\'inactive\'))\r\n                else:\r\n                    return redirect(url_for(\'home\'))\r\n            else:\r\n                cursor.close()\r\n                flash(\'invalid password\')\r\n                return render_template(\'login.html\')\r\n        else:\r\n            cursor.close()\r\n            flash(\'invalid username\')\r\n  